Defendant in custody.
COUNT 1 - BAIL JUMPING:
The defendant is sentenced to the Wisconsin State Prison System for a total of fifty-eight (58) months.  That is twenty-two (22) months initial confinement followed by thirty-six (36) months extended supervision, concurrent with the sentences imposed on 15 CF 33 and 15 CF 445.
The defendant has credit for 110 days.
The Court finds the defendant eligible for both the Challenge Incarceration Program and the Substance Abuse Program.
Conditions of extended supervision:
1) No contact with Family Pantry, Walmart, Shopko and Fleet Farm all in Manitowoc, WI;
2) Maintain absolute sobriety;
3) Submit to random urine screens and pay for same;
4) AODA assessment and follow through;
5) Contact with Yolanda Lavora-Wallander only as approved by the agent;
6) Pay court costs;
7) Pay  supervision fees in an amount to be determined by DOC.

COUNT 8 - MISDEMEANOR THEFT:
The defendant is sentenced to thirty (30) days incarceration, consecutive to counts 14, 15 and 16 of 15 CF 445 but concurrent to the prison sentences imposed on 15 CF 33, 15 CF 445 and count 1 of this case.
Court costs are waived.
